import {useState, useEffect} from 'react';
import axios from 'axios';
import {CHARACTER_URL} from '../../constants'

export default function CharacterCards () {
    const [charcters, setCharacters] = useState([])
    function getCHaracters(){
        return axios.get(CHARACTER_URL)
        .then(charcters => setCharacters(charcters.data))
    }


    useEffect(() => {
        getCHaracters()
    }, [])
    return <div>{charcters.map((charcter) => {
        return
         <div>
            <p>{charcter.name}</p>
            <img src={charcter.image} alt = "doge"/>

        </div>
    })}</div>
}
